				textAlign="left"
				variant="h6"
				fontWeight="bold"
				sx={{
				  overflow: "hidden",
				  textOverflow: "ellipsis",
				  whiteSpace: "nowrap",
				}}
				component="div"
			  >
				{listing.company_name}
			  </Typography>
			  <Typography
				variant="subtitle2"
				textAlign="left"
				sx={{
				  display: "-webkit-box",
				  overflow: "hidden",
				  textOverflow: "ellipsis",
				  WebkitLineClamp: 2, 
				  WebkitBoxOrient: "vertical",
